"use strict";
//Decision Control
let abool1 = 15 > 12;
if (abool1) {
    console.log("Yes");
}
else {
    console.log("No");
}
//Looping Concept
for (let i = 10; i <= 15; i++) {
    console.log(i);
}
let j = 5;
while (j <= 10) {
    console.log(j);
    j++;
}
let k = 15;
do {
    console.log(k);
    k++;
} while (k <= 20);
